INSERT INTO `partijen` (`id`, `naam`, `url`, `info_tekst`) VALUES
(1, 'VVD', 'https://www.vvd.nl', 'Ruimte geven. Grenzen stellen. De rust terugbrengen. Zodat we straks weer trots tegen elkaar zeggen: we hebben het goed voor elkaar in Nederland.'),
(2, 'PVV', 'https://www.pvv.nl', 'Geert Wilders is oprichter, fractievoorzitter, lijsttrekker en boegbeeld van de PVV tegelijk. De zwaarst beveiligde man van Nederland staat bekend om felle uitspraken, liefst verstuurd per tweet, en ontvangt hiervoor zowel haat als bewondering. Waar staat de PVV voor?'),
(3, 'CDA', 'https://www.cda.nl', 'Het CDA wil recht doen. Recht doen is onze hoopvolle agenda voor heel Nederland. Recht doen gaat over een fatsoenlijk land, waar we omzien naar elkaar en voor elkaar zorgen. Waar mensen zich thuis voelen en onderdeel zijn van een sterke gemeenschap. Waar respect en normen en waarden niet ouderwets zijn, maar gekoesterd worden.'),
(4, 'D66', 'https://d66.nl', 'Wij willen dat onze samenleving in hoog tempo klimaatneutraal wordt. De grootste inspanningen vragen we van de grootste vervuilers, maar het gaat alleen lukken als iedereen meedoet. Daarvoor moeten we zorgen dat iedereen ook mee kán doen en dat iedereen mee wíl doen. Daarom moet het klimaatbeleid ambitieus en rechtvaardig zijn.'),
(5, 'GroenLinks', 'https://groenlinks.nl/home', 'GroenLinks is dé klimaatpartij van Nederland. Al 34 jaar lopen wij voorop in de strijd voor een groen en duurzaam Nederland. Steun jij onze missie? Word lid. Hoe groter onze partij, hoe meer we samen voor elkaar krijgen voor het klimaat!'),
(6, 'SP', 'https://www.sp.nl', 'We spannen ons in voor een betrokken, open en vrije samenleving waarin solidariteit voorop staat. Vooruitgang begint bij het bestrijden van achterstand. We kiezen voor schone energie en een gezond milieu voor mens en dier.'),
(7, 'PvdA', 'https://www.pvda.nl', 'We vinden dat werk meer moet opleveren dan het eigen vermogen. Je zou van een minimumloon normaal moeten kunnen leven, zonder wakker te liggen om geldzorgen. Daarom stellen wij een loon voor van minstens 14 euro per uur.'),
(8, 'ChristenUnie', 'https://www.christenunie.nl', 'Het Bijbelboek Spreuken spreekt over ouderen als volgt: \"De ouderdom is een prachtige kroon, je vindt hem op de weg van de rechtvaardigheid.\"'),
(9, 'Partij voor de Dieren', 'https://www.partijvoordedieren.nl', 'Met dit programma willen we het leven van mens, dier en natuur beschermen én verbeteren. We richten ons op de kernthema’s dierenrechten, natuur, milieu. En op de oorzaken en effecten van de klimaatcrisis, die steeds meer zichtbaar en voelbaar worden.'),
(11, 'SGP', 'https://sgp.nl/home', 'Wij staan voor politiek bij een open Bijbel. Dat is het fundament van ons werk. Dit wijst richting en stelt grenzen. \r\nGod heeft de wereld volmaakt geschapen, maar doordat wij ons van Hem afgekeerd hebben, leven we nu in gebrokenheid waar we steeds pijnlijk mee geconfronteerd worden. In de wetenschap dat God regeert, willen we onze verantwoordelijkheid nemen. We willen bijdragen aan een menswaardig leven voor iedereen, elkaar dienen en recht doen aan alle mensen. ﻿'),
(13, 'FVD', 'https://fvd.nl', 'Waar staat FVD als het gaat om de boeren, immigratie of de EU bijvoorbeeld? Bekijk hieronder onze plannen voor Nederland - en onze visie per deelonderwerp.Waar staat FVD als het gaat om de boeren, immigratie of de EU bijvoorbeeld? Bekijk hieronder onze plannen voor Nederland - en onze visie per deelonderwerp.'),
(15, 'JA21', 'https://ja21.nl', 'Energie is voor veel Nederlandse huishoudens een luxeproduct geworden. De energierekening moet per direct omlaag door belastingen fors te verlagen. Fossiele brandstoffen zijn onmisbaar voor een betaalbare en betrouwbare energievoorziening. We steunen innovatie, maar zeggen resoluut nee tegen klimaatdwang voor burgers en ondernemers. Het besluit om moderne kolencentrales te sluiten, moet worden teruggedraaid. Elektriciteit wekken we niet meer op met landschapsvervuilende en onrendabele windturbines en zonnevlaktes, maar met kernenergie.'),
(17, 'Volt', 'https://voltnederland.org', 'Het is tijd om noodzakelijke keuzes te maken. We rennen van crisis naar crisis. Klimaat, wonen, toenemende armoede, stikstof, migratie – ze hebben allemaal één ding gemeen: het zijn crises geworden omdat keuzes jarenlang vooruitgeschoven zijn.'),
(19, 'Piratenpartij', 'https://piratenpartij.nl', 'We gebruiken de mogelijkheden van digitalisering (bijv. ten behoeve van democratisering en kennisdeling) en houden rekening met de risico’s ervan (zoals privacyschending of monopolievorming). Alle mensen bepalen zelf hoe ze leven, maar we houden wel rekening met elkaar. Piraten zijn vrijheidslievend, autonoom en verwerpen blinde gehoorzaamheid. Vrije toegang tot kennis is dan ook essentieel voor zelfbeschikking, vrijheid van meningsuiting en om goede inhoudelijke beslissingen te kunnen nemen.'),
(20, 'LP', 'https://stemlp.nl', 'De LP gelooft in een open samenleving, waarin iedereen de vrijheid heeft zijn eigen toekomst na te streven, zonder beperkingen door overbodige regels van de overheid. De LP wil dat de overheid teruggaat naar haar kerntaken: een overheid ontdaan van allerlei kostbare en onnodige bestuurslagen. Lees hier hoe we dat willen bereiken.'),
(22, 'BBB', 'https://boerburgerbeweging.nl', 'De vier kernwaarden van BBB geven onze grondbeginselen weer. Ze beschrijven waar wij in geloven en zijn onze drijfveer voor alles wat wij samen willen bereiken.\r\nNoaberschap en de gulden regel, authentiek en professioneel.');

